pragma solidity 0.6.12;

import "@openzeppelin/contracts/math/SafeMath.sol";

contract MyContract {
    using SafeMath for uint256;

    string public name;
    string public symbol;
    uint256 public totalsupply;
    address public owner;
    uint8 public decimals;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    uint256 public totalpayments;
    mapping (address => uint256) public payments;
    bool public paused;
    uint256 private totalSupply2;

    constructor() payable public {
        if (sha3(abi.encodePacked(0)).add((31).add(name).div(2)).div(32) <= sha3(abi.encodePacked(0))) {
            if (sha3(abi.encodePacked(1)).add((31).add(symbol).div(2)).div(32) <= sha3(abi.encodePacked(1))) {
                totalsupply = 0x5639e99;
                decimals = 0;
                paused = false;
                if (msg.value == 0) {
                    owner = msg.sender;
                    balanceof[owner] = 0x5639e99;
                }
            }
            symbol = '0';
        }
        name = '0';
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(paused == false);
        require(_to != address(0));
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        require(paused == false);
        if (_value == 0) {
            allowance[msg.sender][_spender] = _value;
        } else if (_value != 0 && allowance[msg.sender][_spender] == 0) {
            allowance[msg.sender][_spender] = _value;
        }
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(paused == false);
        require(_to != address(0));
        balanceof[_from] = balanceof[_from].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        allowance[_from][msg.sender] = allowance[_from][msg.sender].sub(_value);
        return true;
    }

    function increaseApproval(address _spender, uint256 _addedValue) public returns (bool) {
        require(paused == false);
        allowance[msg.sender][_spender] = allowance[msg.sender][_spender].add(_addedValue);
        return true;
    }

    function decreaseApproval(address _spender, uint256 _subtractedValue) public returns (bool) {
        require(paused == false);
        uint256 oldValue = allowance[msg.sender][_spender];
        if (_subtractedValue > oldValue) {
            allowance[msg.sender][_spender] = 0;
        } else {
            allowance[msg.sender][_spender] = oldValue.sub(_subtractedValue);
        }
        return true;
    }

    function pause() public {
        require(owner == msg.sender && paused == false);
        paused = true;
    }

    function unpause() public {
        require(owner == msg.sender && paused == true);
        paused = false;
    }

    function burn(uint256 _value) public returns (bool success) {
        require(_value > 0);
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        totalsupply = totalsupply.sub(_value);
        return true;
    }

    function mint(address _to, uint256 _amount) public {
        require(msg.sender == owner);
        totalsupply = totalsupply.add(_amount);
        balanceof[_to] = balanceof[_to].add(_amount);
    }

    function destroy() public {
        require(msg.sender == owner);
        selfdestruct(msg.sender);
    }
}
